import React from 'react';

import Hero from '../components/Hero';
import Content from '../components/Content';

function AboutPage(props) {

    return (
        <div>
            <Hero title={props.title} />

            <Content>
                <h3>Who am I?</h3>
                <p>My name is Joseph Wolff. I am a full stack web developer based out of the Nashville, TN area.</p>
                <p>I have a Full Stack Web Development Certification from Woz-U.</p>
            </Content>
        </div>
    );
}

export default AboutPage;
